 @brunosozafilhofilho5260  contra o galo jogou com 4 reservas e o lateral era o segundo reserva porque o primeiro reserva estava machucado... praticamente 5 desfalques e colocou o galo pra se defender segundo tempo inteiro e o primeiro tempo jogou de igual pra igual, só levou muito azar de tomar 2 gols, principalmente o segundo.

O time está invicto em casa nesta temporada, já foram 11 jogos e nenhum derrota. O time do Coritiba é um time "fraco" de elenco, não tem nenhum nome, mas está muito bem entrosado e isso vale muito num campeonato longo. Acredito que termine entre os 10 esse ano.

Gosto de futebol, ainda mais quando tem jogos iguais esses, onde os times jogam pra ganhar com vontade... não fica aquele toca pro lado pra segurar resultado...

